$objectType = CategoryHandler::getInstance()->getObjectTypeByName('com.woltlab.wcf.bbcode.smiley');

foreach ($categoryData as $group => $emojis) {
    $categoryAction = new CategoryAction([], 'create', [
        'data' => [
            'objectTypeID' => $objectType->objectTypeID,
            'title' => $group
        ]
    ]);
    $categoryAction->executeAction();
    $returnValues = $categoryAction->getReturnValues();

    $list = new SmileyList();
    $list->getConditionBuilder()->add('smileyCode IN (?) AND packageID = ?', [$emojis, $this->installation->getPackageID()]);
    $list->readObjects();
    $smileys = $list->getObjects();

    if (!count($smileys)) continue;

    $smileyAction = new SmileyAction($smileys, 'update', [
        'data' => [
            'categoryID' => $returnValues['returnValues']->categoryID
        ]
    ]);
    $smileyAction->executeAction();
}
